import React, { useState } from "react";
import { useParams } from "react-router-dom";
import PracticeConsole from "../components/PracticeConsole";

const BACKTRACKING_QUESTIONS = [
  {
    title: "Letter Combinations of a Phone Number",
    description:
      "Given a string containing digits from 2-9 inclusive, return all possible letter combinations.",
  },
  {
    title: "Generate Parentheses",
    description:
      "Given n pairs of parentheses, generate all combinations of well-formed parentheses.",
  },
  {
    title: "Combination Sum",
    description:
      "Return all unique combinations that sum to target.",
  },
  {
    title: "Permutations",
    description:
      "Return all possible permutations.",
  },
  {
    title: "N-Queens",
    description:
      "Place n queens such that no two attack each other.",
    image: "/nqueens.png",
  },
  {
    title: "Subsets",
    description:
      "Return all possible subsets.",
  },
  {
    title: "Palindrome Partitioning",
    description:
      "Return all palindrome partitions.",
  },
];

export default function TopicPractice() {
  const { topic } = useParams();
  const questions = BACKTRACKING_QUESTIONS;

  const [currentIndex, setCurrentIndex] = useState(0);
  const [status, setStatus] = useState(
    Array(questions.length).fill("unattempted")
  );

  // ðŸ”¥ SUBMIT LOGIC (can override previous result)
  function handleSubmit(isCorrect) {
    const updated = [...status];
    updated[currentIndex] = isCorrect ? "correct" : "wrong";
    setStatus(updated);
  }

  // ðŸ”¥ NEXT LOGIC
  function handleNext() {
    const updated = [...status];

    if (updated[currentIndex] === "unattempted") {
      updated[currentIndex] = "skipped";
      setStatus(updated);
    }

    if (currentIndex < questions.length - 1) {
      setCurrentIndex(currentIndex + 1);
    }
  }

  // ðŸ”¥ CLICK NUMBER BOX (go back and redo)
  function goToQuestion(index) {
    setCurrentIndex(index);
  }

  return (
    <div
      style={{
        padding: "50px",
        background: "#f8fafc",
        minHeight: "100vh",
        fontFamily: "Inter, sans-serif",
      }}
    >
      {/* ðŸ”¥ QUESTION TRACKER */}
      <div
        style={{
          display: "flex",
          gap: 15,
          marginBottom: 40,
        }}
      >
        {questions.map((_, i) => {
          const bg =
            status[i] === "correct"
              ? "#22c55e"
              : status[i] === "wrong"
              ? "#ef4444"
              : status[i] === "skipped"
              ? "#8b5cf6"
              : "#e2e8f0";

          const color =
            status[i] === "unattempted" ? "#1e293b" : "#ffffff";

          return (
            <div
              key={i}
              onClick={() => goToQuestion(i)}
              style={{
                width: 45,
                height: 45,
                borderRadius: 12,
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
                fontWeight: 700,
                background: bg,
                color: color,
                cursor: "pointer",
                transition: "all 0.2s ease",
                boxShadow:
                  currentIndex === i
                    ? "0 0 0 3px rgba(99,102,241,0.3)"
                    : "none",
              }}
            >
              {i + 1}
            </div>
          );
        })}
      </div>

      {/* ðŸ”¥ MAIN LAYOUT */}
      <div style={{ display: "flex", gap: 50 }}>
        {/* LEFT SIDE â€” PROBLEM */}
        <div
          style={{
            flex: 1,
            background: "#ffffff",
            padding: 35,
            borderRadius: 20,
            boxShadow: "0 20px 60px rgba(0,0,0,0.05)",
          }}
        >
          <h2 style={{ fontWeight: 700 }}>
            {questions[currentIndex].title}
          </h2>

          <p style={{ marginTop: 20, color: "#475569" }}>
            {questions[currentIndex].description}
          </p>

          {questions[currentIndex].image && (
            <img
              src={questions[currentIndex].image}
              alt="visual"
              style={{
                marginTop: 25,
                width: "100%",
                borderRadius: 12,
              }}
            />
          )}
        </div>

        {/* RIGHT SIDE â€” CODE */}
        <div
          style={{
            flex: 1.2,
            background: "#ffffff",
            padding: 35,
            borderRadius: 20,
            boxShadow: "0 20px 60px rgba(0,0,0,0.05)",
          }}
        >
          <PracticeConsole />

          <div
            style={{
              marginTop: 30,
              display: "flex",
              gap: 20,
            }}
          >
            <button
              onClick={() => handleSubmit(true)}
              style={{
                padding: "12px 25px",
                background: "#22c55e",
                color: "#fff",
                borderRadius: 12,
                border: "none",
                cursor: "pointer",
                fontWeight: 600,
              }}
            >
              Submit (Correct)
            </button>

            <button
              onClick={() => handleSubmit(false)}
              style={{
                padding: "12px 25px",
                background: "#ef4444",
                color: "#fff",
                borderRadius: 12,
                border: "none",
                cursor: "pointer",
                fontWeight: 600,
              }}
            >
              Submit (Wrong)
            </button>

            <button
              onClick={handleNext}
              style={{
                padding: "12px 25px",
                background: "#6366f1",
                color: "#fff",
                borderRadius: 12,
                border: "none",
                cursor: "pointer",
                fontWeight: 600,
              }}
            >
              Next
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}
